    this.state = {
    name:"Abhi",
     empId:this.props.empId

    };

   

}

handleClick =() =>{
console.log("Button Clicked", this);
}

render() {
		return (
			<div>
			<h1>Hello {this.state.name} your EmpId is {this.state.empId}</h1>
			<button onClick={this.handleClick}>Click Me</button>
			</div>
		)
	}
}

export default employee
